import React from 'react';
import { View, Text, TouchableOpacity, StyleSheet, Dimensions } from 'react-native';

const { height,width } = Dimensions.get('window');

const BuySell = () => {
  return (
    <View style={styles.container}>
      <TouchableOpacity style={styles.button} onPress={() => console.log('Buy button pressed')}>
        <Text style={styles.buttonText}>Buy</Text>
      </TouchableOpacity>
      <TouchableOpacity style={styles.button} onPress={() => console.log('Sell button pressed')}>
        <Text style={styles.buttonText}>Sell</Text>
      </TouchableOpacity>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    backgroundColor: '#fff',
    flexDirection: 'row',
    justifyContent: 'space-between',
    padding: 16,
    zIndex:10,
    height: height*0.13,
    border: 2
  },
  button: {
    flex: 0.3,
    backgroundColor: 'green', // Change to 'red' for the Sell button
    borderRadius: 8,
    padding: 12,
    alignItems: 'center',
  },
  buttonText: {
    color: 'white',
    fontWeight: 'bold',
  },
});

export default BuySell;
